The Spider-Slayer is scheduled for execution and Mayor J. Jonah Jameson is leaving nothing to chance, having called in the one man he can trust to oversee everything - the Superior Spider-Man. Since the startling events of Superior Spider-Man #9, will anyone realize that things have changed...?

